  min-width: 100px;
  justify-items: center;
  align-items: center;
}
.carousel .carousel__track-container .carousel__track .carousel__slide .carousel__precio h6 {
  color: #343434;
  width: 90px;
  text-align: right;
  z-index: 1;
  display: flex;
  position: relative;
}
.carousel .carousel__track-container .carousel__track .carousel__slide .carousel__precio .carousel__precio--img {
  width: 100%;
  display: none;
  position: relative;
  transform: translateX(-70%);
}
.carousel .carousel__track-container .carousel__track .carousel__slide .carousel__image {
  z-index: 0;
  width: 100%;
  height: 100%;
  top: 0;
  object-fit: cover;
}
.carousel .is-hidden {
  display: none;
}

.background {
  display: flex;
  position: absolute;
  z-index: -1;
  justify-self: center;
  width: 100vw;
  height: auto;
  overflow: hidden;
}

.background--servicios {
  top: 105vh;
  left: 0;
  width: 100vw;
  height: 100vh;
}
.background--servicios img {
  width: auto;
  height: 100%;
  transform: translateX(-80%);
}

.background--contacto {
  top: 200vh;
  width: 100vw;
  height: 100vh;
  right: -10vw;
}
.background--contacto img {
  width: auto;
