.navbar {
    background-color: $white;
    border-bottom: 1px solid #fff;
    z-index: 2;
    position: fixed;
    top: 0;
    width: 100vw;
    height: 6vh;
    min-height: 60px;

    .navbar__container {
        display: flex;
        img {
            display: none;
        }

        .navbar__options {
            display: flex;
            justify-content: space-between;
            width: 80vw;
            min-width: 290px;
            position: absolute;
            top: 50%;
            transform: translateY(-50%);
            left: 10vw;
            list-style-type: none;

            li {
                position: relative;
            

                a {
                    text-decoration: none;
                    color: $black;
                    @extend %text;
                }

                a:hover {
                    color: black;
                }

                a::before {
                    content: "";
                    display: block;
                    position: absolute;
                    top: 3vh;
                    height: 4px;
                    width: 0%;
                    background: $lightGradient;

                    transition: all ease-in-out 250ms;
                }

                a:hover::before {
                    width: 100%;
                }
            }
        }
    }
}

.carousel {
    position: relative;
    height: 100vh;
    width: 80vw;
    margin: 0 auto;

    .carousel__button {
    position: absolute;
    top: 50%;
    transform: translateY(-50%);
    background: transparent;
    border: 0;
    cursor: pointer;
    img {
        width: 15px;
    }
    }

    .carousel__button--left {
    left: -20px;
    }

    .carousel__button--right {
    right: -20px;
    }

    .carousel__nav {
    display: flex;
    justify-content: center;
    padding: 10px 0;
    position: relative;
    top: -5%;
    .carousel__indicator {
        border: 0;
        border-radius: 50%;
        width: 15px;
        height: 15px;
        background: rgba(0, 0, 0, 0.3);
        margin: 0 10px;
        cursor: pointer;
    }
    .carousel__indicator.current-slide {
        background: rgba(0, 0, 0, 0.75);
    }
    }

    .carousel__track-container {
    height: 100%;
    position: relative;
    overflow: hidden;
    .carousel__track {
        list-style: none;
        position: relative;
        height: 100%;
        transition: transform 250ms ease-in-out;
        .carousel__slide {
            position: absolute;
            top: 0;
            bottom: 0;
            width: 100%;
            .carousel__text {
                position: absolute;
                top: 10%;
                left: 0;
                width: 70%;
                height: 90vh;
                .carousel__cta {
                    position: relative;
                    top: 10%;
                    @extend %footer;
                    @extend %ctaHome;
                }
                .carousel__text--title {
                @extend %bigHeader;
                }
                .carousel__text--description {
                @extend %subHeader;
                padding-top: 20%;
                padding-bottom: 10%;
                }
                .carousel__text--detail {
                    @extend %text;
                    background-color: rgba(255, 255, 255, 0.9);
                }
            }

            .carousel__precio {
                display: flex;
                position: absolute;
                top: 10vh;
                right: 0vw;
                width: 3vw;
                min-width: 100px;
                justify-items: center;
                align-items:center;
                h6 {
                    @extend %text;
                    color: $black;
                    width: 90px;
                    text-align:right;
                    z-index: 1;
                    display: flex;
                    position: relative;
                }
                .carousel__precio--img {
                    width: 100%;
                    display: none;
                    position: relative;
                    transform: translateX(-70%);
                }
            }



            .carousel__image {
                z-index: 0;
                width: 100%;
                height: 100%;
                top: 0;
                object-fit: cover;
            }
        }
    }
    }

    .is-hidden {
    display: none;
    }
}

.background {
    display: flex;
    position: absolute;
    z-index: -1;
    justify-self: center;
    width: 100vw;
    height: auto;
    overflow: hidden;
}

.background--servicios {
    top: 105vh;
    left: 0;
    width: 100vw;
    height: 100vh;
    img {
        width: auto;
        height: 100%;
        transform: translateX(-80%);
    }
}

.background--contacto {
    top: 200vh;
    width: 100vw;
    height: 100vh;
    right: -10vw;
    img {
        width: auto;
        height: 100%;
        transform: translateX(30%);
    }
}

.servicios {
    position: relative;
    height: 94vh;
    min-height: 750px;
    width: 90vw;
    margin: 0 auto;
    top: 5vh;

    .servicios__title {
        @extend %header;
        text-transform: uppercase;
        position: relative;
        height: 41px;
        width: 100%;
        top: 10%;
        text-align: center;
        h1 {
            vertical-align: middle;
        }
    }
    .servicios__container {
        position: relative;
        top: 10%;
        left: 0;
        width: 100%;
        height: 85vh;
        display: grid;
        grid-template-columns: 1fr;
        grid-template-rows: 1fr 1fr 1fr 1fr 1fr 1fr 1fr 1fr 1fr 1fr;
        grid-gap: 1%;

        .servicios__card {
            height: 100%;
            min-height: 50px;
            width: 100%;
            display: grid;
            grid-template-columns: 1fr 3fr;
            grid-template-rows: 1fr;
            grid-template-areas: "icon title";
            align-items: center;
            justify-content: center;
            background-color: rgb(255, 255, 255);
            box-shadow: 1px 4px 8px rgba(0, 0, 0, 0.25);
            border-radius: 4px;

            .card__img {
                display: none;
                img {
                    @extend %cardImg;
                }
            }

            .card__icon {
                grid-area: icon;
                .card__icon--small {
                img {
                    width: 80%;
                    max-height: 30px;
                    margin-left: 10%;
                    top: 50%;
                    left: 50%;
                }
                }

                .card__icon--big {
                    display: none;
                }
            }

            .card__text {
            white-space: nowrap;
            grid: "title";
            h4 {
                justify-content: center;
                align-content: center;
                text-align: start;
                @extend %subHeader;
            }
            h6 {
                display: none;
                @extend %footer;
            }
        }
        }
    }
}

.contacto {
    position: relative;
    height: 94vh;
    min-height: 650px;
    width: 80vw;
    margin: 0 auto;
    top: 5vh;
    .contacto__title {
    @extend %header;
    text-transform: uppercase;
    position: relative;
    height: 41px;
    width: 100%;
    top: 10%;
    text-align: center;
    }

    .contacto__container {
    position: relative;
    top: 10%;
    left: 0;
    width: 100%;
    height: 80vh;
    min-height: 600px;
        .contacto__left {
            position: relative;
            top: 0;
            height: 55%;
            width: 100%;
            padding: 3%;
            color: $black;
            background-color: #1e71b92f;
            border: 2px solid $black;
            border-radius: 5px;
            backdrop-filter: blur(2px);
            form {
                position: relative;
                overflow: auto;
                width: 100%;
                height: 100%;
                box-sizing: border-box;
                label{
                    display: block;
                    color: grey;
                }
                textarea {
                    padding: 3%;
                    -webkit-box-sizing: border-box;
                    -moz-box-sizing: border-box;
                    box-sizing: border-box;
                    height: 30%;
                }
                input {
                    margin-bottom: 2%;
                    display: block;
                }
            }
        }

        .contacto__right {
            position: relative;
            top: 2%;
            height: 38%;
            width: 100%;
            padding: 5%;
            color: #343434;
            background-color: #1e71b92f;
            border: 2px solid $black;
            border-radius: 5px;
            backdrop-filter: blur(2px);
            display: flex;

            .contacto__right--logo {
                display: none;
            }
            .contacto__right--ubicacion {
                display: inline;
                height: 40%;
                position: relative;
                top: 1%;
                left: 1%;
                h6 {
                    @extend %subHeader;
                }
                p {
                    @extend %text;
                }
            }
            .contacto__right--iconos {
                display: block;
                position: absolute;
                top: 50%;
                left: 5%;
                img {
                    list-style-type: none;
                    display: flex;
                    justify-content: center;
                    margin-bottom: 50%;
                    max-width: 30px;
                }
            }
            .contacto__right--text {
                display: block;
                position: absolute;
                top: 50%;
                left: 20%;
                @extend %footer;
                .contacto__right--text--telefonos {
                    @extend %text;
                }
                .contacto__right--text--mail {
                    @extend %text;
                    margin-top: 1.5vh;
                }
            }
        }

    }

    .contacto__map {
        iframe {
            display: none;
            z-index: 1;
        }
    }
}

footer {
