        .homeoffice__footer {
            top: 20vh;
        }
    }
}

@media only screen and (min-width: 1025px) {
    .homeoffice {
        .homeoffice__container {
            background-size: 35%;
            overflow: visible;
            .homeoffice__title {
                h1 {
                    top: 2.5vh;
                    left: 13%;
                }
            }
            .homeoffice__beneficios {
                width: 70vw;
                height: auto;
                top: 5%;
                left: 15vw;
                grid-template-columns: 1fr 1fr 1fr;
                grid-template-rows: 1fr 1fr;
                grid-gap: 10%;
                .homeoffice__beneficios__card {
                    grid-template-columns: 1fr;
                    grid-template-rows: 5fr 1fr;
                    grid-template-areas:    "img"
                                            "titulo";
                    justify-content: center;
                    align-content: center;
                    width: 250px;
                    height: 180px;
                    img {
                        width: 120px;
                        justify-self: center;
                        align-self: center;
                    }
                    h3 {
                        width: 200px;
                        text-align: center;
                        justify-self: center;
                        align-self: center;
                    }
                }
            }
        }



        .tabla {
            top: 0vh;
            .tabla__section {
                margin: 2em auto;
                .tabla__planes {
                    .tabla__plan__unidad {
                        width: 23%;
                        margin: 0 1.33% 20px 0;
                        transition: all .25s;
                        .tabla__plan__unidad--container {
                            .button {
                                a {
                                    transition: all .25s;
                                }
                                a:hover {
                                    background: $darkGradient;
                                    color: #fff;
                                }
                            }
                        }
                    }
                    .tabla__plan__unidad:hover {
                        transform: scale(1.04);
                    }
                }
            }
        }
        .tabla__section .tabla__planes > li:last-child {
            margin-right: 0;
        }
        .homeoffice__footer {
            top: 25vh;
            height: 50vh;
        }
    }
}

@media only screen and (min-width: 1919px) {
    .homeoffice {
        .tabla {
            top: 0vh;
        }
        .homeoffice__footer {
            height: 35vh;
        }
    }
}

